import { useMemo } from 'react';
import {
  MaterialReactTable,
  useMaterialReactTable,
  MRT_ActionMenuItem
} from 'material-react-table';

const data = [
  {
    main: 'Main Ranking 1',
    add: 'Additional Ranking 1',
    weight: 0.5,
  },
];

const Table = () => {
  //should be memoized or stable
  const columns = useMemo(
    () => [
      {
        accessorKey: 'main',
        header: 'Main Rankings',
        size: 200,
        enableEditing: false,
      },
      {
        accessorKey: 'add',
        header: 'Additional Rankings',
        size: 200,
        enableEditing: false,

      },
      {
        accessorKey: 'weight', 
        header: 'Weights (0 to 1)',
        size: 200,
        enableEditing: true,
      },
    ],
    [],
  );

  const table = useMaterialReactTable({
    columns,
    data, 
    enableEditing: true,
    onEditingRowSave: ({ table, values }) => {
      table.setEditingRow(null); //exit editing mode
    },
    onEditingRowCancel: () => {
    },
    muiEditRowDialogProps: {
    },
    renderEditRowDialogContent: ({ internalEditComponents, row, table }) => {
    },
  });

  return <MaterialReactTable
columns={columns}
data={data}
enableRowActions
renderRowActionMenuItems={({ row, table }) => [
<MRT_ActionMenuItem //or just use a normal MUI MenuItem component
icon={<Edit />}
key="edit"
label="Edit"
onClick={() => console.info('Edit')}
table={table}
/>,
<MRT_ActionMenuItem
icon={<Delete />}
key="delete"
label="Delete"
onClick={() => console.info('Delete')}
table={table}
/>,
]}
/>
};

export default Table;
